    product = (<div className={styles.product}>
      <img src={props.url} alt='test' />
      <h3>{props.caption}</h3>
      <p>{props.desc}</p>
      <Button type='button'>Подробнее</Button>
    </div>)
  }
  return (
    (product)      
  )
}

export default product
